import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-responsive-popover", tags, suffix)} placement-type="Bottom" horizontal-align="Stretch" class="${classMap(context.classes.popover)}" hide-arrow _disable-initial-focus @ui5-selection-change=${ifDefined(context._listSelectionChange)} @ui5-after-close=${ifDefined(context._afterClosePicker)} @ui5-before-open=${ifDefined(context._beforeOpen)} @ui5-after-open=${ifDefined(context._afterOpenPicker)}>${ context._isPhone ? block1(context, tags, suffix) : undefined }${ !context._isPhone ? block6(context, tags, suffix) : undefined }${ context.filterSelected ? block11(context, tags, suffix) : block13(context, tags, suffix) }${ context._isPhone ? block15(context, tags, suffix) : undefined }</${scopeTag("ui5-responsive-popover", tags, suffix)}>${ context.hasValueStateMessage ? block16(context, tags, suffix) : undefined } `;
const block1 = (context, tags, suffix) => html`<div slot="header" class="ui5-responsive-popover-header" style="${styleMap(context.styles.popoverHeader)}"><div class="row"><span>${ifDefined(context._headerTitleText)}</span><${scopeTag("ui5-button", tags, suffix)} class="ui5-responsive-popover-close-btn" icon="decline" design="Transparent" @click="${context.handleCancel}"></${scopeTag("ui5-button", tags, suffix)}></div><div class="row"><div slot="header" class="input-root-phone" value-state="${ifDefined(context.valueState)}"><input .value="${ifDefined(context.value)}" inner-input placeholder="${ifDefined(context.placeholder)}" value-state="${ifDefined(context.valueState)}" @input="${context._inputLiveChange}" @change=${context._inputChange} aria-autocomplete="both" aria-labelledby="${ifDefined(context._id)}-hiddenText-nMore" aria-describedby="${ifDefined(context._id)}-valueStateDesc" /></div><${scopeTag("ui5-toggle-button", tags, suffix)} slot="header" class="ui5-multi-combobox-toggle-button" icon="multiselect-all" design="Transparent" ?pressed=${context._showAllItemsButtonPressed} @click="${context.filterSelectedItems}"></${scopeTag("ui5-toggle-button", tags, suffix)}></div>${ context.hasValueStateMessage ? block2(context, tags, suffix) : undefined }</div></div>`;
const block2 = (context, tags, suffix) => html`<div class="${classMap(context.classes.popoverValueState)}" style="${styleMap(context.styles.popoverValueStateMessage)}"><${scopeTag("ui5-icon", tags, suffix)} class="ui5-input-value-state-message-icon" name="${ifDefined(context._valueStateMessageIcon)}"></${scopeTag("ui5-icon", tags, suffix)}>${ context.shouldDisplayDefaultValueStateMessage ? block3(context, tags, suffix) : block4(context, tags, suffix) }</div>`;
const block3 = (context, tags, suffix) => html`${ifDefined(context.valueStateText)}`;
const block4 = (context, tags, suffix) => html`${ repeat(context.valueStateMessageText, (item, index) => item._id || index, (item, index) => block5(item, index, context, tags, suffix)) }`;
const block5 = (item, index, context, tags, suffix) => html`${ifDefined(item)}`;
const block6 = (context, tags, suffix) => html`${ context.hasValueStateMessage ? block7(context, tags, suffix) : undefined }`;
const block7 = (context, tags, suffix) => html`<div slot="header" @keydown="${context._onValueStateKeydown}" tabindex="0" class="ui5-responsive-popover-header ${classMap(context.classes.popoverValueState)}" style=${styleMap(context.styles.popoverValueStateMessage)}><${scopeTag("ui5-icon", tags, suffix)} class="ui5-input-value-state-message-icon" name="${ifDefined(context._valueStateMessageIcon)}"></${scopeTag("ui5-icon", tags, suffix)}>${ context.shouldDisplayDefaultValueStateMessage ? block8(context, tags, suffix) : block9(context, tags, suffix) }</div>`;
const block8 = (context, tags, suffix) => html`${ifDefined(context.valueStateText)}`;
const block9 = (context, tags, suffix) => html`${ repeat(context.valueStateMessageText, (item, index) => item._id || index, (item, index) => block10(item, index, context, tags, suffix)) }`;
const block10 = (item, index, context, tags, suffix) => html`${ifDefined(item)}`;
const block11 = (context, tags, suffix) => html`<${scopeTag("ui5-list", tags, suffix)} separators="None" mode="MultiSelect" class="ui5-multi-combobox-all-items-list">${ repeat(context.selectedItems, (item, index) => item._id || index, (item, index) => block12(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}>`;
const block12 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li", tags, suffix)} type="${ifDefined(context._listItemsType)}" additional-text=${ifDefined(item.additionalText)} ?selected=${item.selected} data-ui5-token-id="${ifDefined(item._id)}" data-ui5-stable="${ifDefined(item.stableDomRef)}" @keydown="${context._onItemKeydown}">${ifDefined(item.text)}</${scopeTag("ui5-li", tags, suffix)}>`;
const block13 = (context, tags, suffix) => html`<${scopeTag("ui5-list", tags, suffix)} separators="None" mode="MultiSelect" class="ui5-multi-combobox-all-items-list">${ repeat(context._filteredItems, (item, index) => item._id || index, (item, index) => block14(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}>`;
const block14 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li", tags, suffix)} type="${ifDefined(context._listItemsType)}" additional-text=${ifDefined(item.additionalText)} ?selected=${item.selected} data-ui5-token-id="${ifDefined(item._id)}" data-ui5-stable="${ifDefined(item.stableDomRef)}" @keydown="${context._onItemKeydown}">${ifDefined(item.text)}</${scopeTag("ui5-li", tags, suffix)}>`;
const block15 = (context, tags, suffix) => html`<div slot="footer" class="ui5-responsive-popover-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context.handleOK}">${ifDefined(context._dialogOkButton)}</${scopeTag("ui5-button", tags, suffix)}></div>`;
const block16 = (context, tags, suffix) => html`<${scopeTag("ui5-popover", tags, suffix)} skip-registry-update _disable-initial-focus prevent-focus-restore no-padding hide-arrow class="ui5-valuestatemessage-popover" placement-type="Bottom" horizontal-align="Left"><div slot="header" class="${classMap(context.classes.popoverValueState)}" style="${styleMap(context.styles.popoverHeader)}"><${scopeTag("ui5-icon", tags, suffix)} class="ui5-input-value-state-message-icon" name="${ifDefined(context._valueStateMessageIcon)}"></${scopeTag("ui5-icon", tags, suffix)}>${ context.shouldDisplayDefaultValueStateMessage ? block17(context, tags, suffix) : block18(context, tags, suffix) }</div></${scopeTag("ui5-popover", tags, suffix)}>`;
const block17 = (context, tags, suffix) => html`${ifDefined(context.valueStateText)}`;
const block18 = (context, tags, suffix) => html`${ repeat(context.valueStateMessageText, (item, index) => item._id || index, (item, index) => block19(item, index, context, tags, suffix)) }`;
const block19 = (item, index, context, tags, suffix) => html`${ifDefined(item)}`;


export default block0;
